/deep/.el-table__body-wrapper::-webkit-scrollbar {
  height: 10px !important;
}
.classify {
  margin: 0 16px 16px 16px;
  height: calc(100vh - 135px);
  display: flex;
  justify-content: center;
  align-items: center;
  background: #fff;
  border-radius: 16px;

  .upload-demo {
    width: 300px;
    display: flex;
    justify-content: center;

    ::v-deep .el-upload-list {
      display: none;
    }

    .el-button {
      background: #79AC43;
      color: #fff;
    }

    .el-button:hover {
      opacity: 0.8;
    }
  }
  ::v-deep .el-dialog__wrapper.tipDialog {
    .el-dialog {
        border-radius: 8px;
        padding: 16px;
        box-sizing: border-box;

        .el-dialog__header {
            padding: 0;
            // display: none;
        }

        .el-dialog__body {
            padding: 0;
            font-size: 14px;
            
            i {
                color: #79AC43;
                font-size: 16px;
                margin-right: 8px;
            }

            .title {
                color: rgba(0, 0, 0, 0.9);
                line-height: 20px;
            }
            .el-table {
              margin-top: 12px;
            }
        }
    }
  }
}
